    constructor(props){
        super(props);

        this.state = {
            list:[]
        }
    }

    async componentDidMount(){
        let datas = await this.props.datas;
        let list =  datas.map((value, index) => { return <li key={index}>{value.mail} <button onClick={() => {console.log("ok");}}></button></li>})
        this.setState({list:list})
    }


    render(){
        console.log()
        return(
            <div>
                <ul>{this.state.list}</ul>
            </div>
        )
    }
}

function mapStateToProps(state){
    return {
      datas: state.reducer,
    };
  }
  export default connect(mapStateToProps)(Admin);
